const Navbar = () => {
  return(
    <header className="header">
      <a href="/" className="logo">Workout App</a>

      <nav className="navbar">
        <a href="/">Home</a>
        <a href="/">Exercise</a>
        <a href="/">Diet</a>
        <a href="/login">Log In</a>
        <a href="/signup">Sign Up</a>
      </nav>
    </header>
  )
}

export default Navbar;



